import React from 'react'
import * as FaIcons from 'react-icons/fa' 
import { Dashboard } from '../pages/Dashboard'
import { Reports } from '../pages/Reports'

export const NavigationData = [
    {
        title: 'Dashboard',
        path: '/',
        com: Dashboard
    },
    {
        title: 'Reports',
        path: '/reports',
        com: Reports
    }
]
